import React from "react";
import DonorOrNGO from "./components/DonorOrNGO";
import { Switch, Route, Redirect } from "react-router-dom";
import SignUpAsDonor from "./components/Auth/SignUpAsDonor";
import SignUpAsNGO from "./components/Auth/SignUpAsNGO";
import LogInAsDonor from "./components/Auth/LogInAsDonor";
import LogInAsNGO from "./components/Auth/LogInAsNGO";
import AllCampaigns from "./components/createCampaign/AllCampaigns";
import NewCampaign from "./components/createCampaign/NewCampaign";
import Heading from "./components/Heading";
import Navbar from "./components/Navbar";
import GetCampaign from "./components/createCampaign/GetCampaign";
import Heading2 from "./components/Heading2";
import Navbar2 from "./components/Navbar2";
function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <Navbar />
          <Redirect to="/landingPage" />
        </Route>
        <Route path="/landingPage">
          <Navbar />
          <DonorOrNGO />
        </Route>
        <Route path="/suD">
          <Navbar />
          <SignUpAsDonor />
        </Route>
        <Route path="/suN">
          <Navbar />
          <SignUpAsNGO />
        </Route>
        <Route path="/liD">
          <Navbar />
          <LogInAsDonor />
        </Route>
        <Route path="/liN">
          <Navbar />
          <LogInAsNGO />
        </Route>
        <Route path="/cmcF">
          <Navbar />
          <NewCampaign />
        </Route>
        <Route path="/homePage">
          <Navbar2 />
          <Heading />
          <AllCampaigns />
        </Route>
        <Route path="/yourCampaign">
          <Heading2 />
          <GetCampaign />
        </Route>
      </Switch>
    </div>
  );
}
export default App;
